                logger.error("Unable to retrieve latest version: HTTP ERROR CODE: " + e.getMessage());
                return null;
            } finally {
                if (in != null) {
                    try {
                        in.close();
                    } catch (Exception e) {
                        logger.error(e);
                    }
                }
            }
        }

