    do {
        permut = false;
        for (int i = 0; i < length - 1; i++) {
            if (enemy_dist[i].value > enemy_dist[i + 1].value) {
                Index_value a = enemy_dist[i];
                enemy_dist[i] = enemy_dist[i + 1];
                enemy_dist[i + 1] = a;
                permut = true;
