                    }
                    System.out.println("Waiting thread interrupted! (THIS IS GOOD)");
                    e.printStackTrace();
                }
            }
        };
        waiter.start();
        if (interruptWait) {
            new Thread() {

                public void run() {
                    try {
                        Thread.sleep(2000);
                    } catch (Exception e) {
                    }
                    waiter.interrupt();
                }
            }.start();
        }
        Thread poller = new Thread() {

            public void run() {
                int exitCode = -99;
