                } catch (Throwable e) {
                    e.printStackTrace();
                    throw new Error("TestRuntimeExec FAILED");
                }
            }
        };
        writer.start();
        reader.start();
        final Thread waiter = new Thread() {

            public void run() {
                try {
                    int exitCode = tac.waitFor();
                    System.out.println("waitFor(): Process exited with code " + exitCode);
                } catch (InterruptedException e) {
                    if (!interruptWait) {
                        System.out.println("Waiting thread uninterrupted unexpectedly!!!");
                        System.out.println("TestRuntimeExec FAILED");
                        System.exit(1);
                    }
                    System.out.println("Waiting thread interrupted! (THIS IS GOOD)");
                    e.printStackTrace();
                }
            }
        };
        waiter.start();
        if (interruptWait) {
            new Thread() {

                public void run() {
                    try {
                        Thread.sleep(2000);
                    } catch (Exception e) {
                    }
                    waiter.interrupt();
                }
            }.start();
        }
        Thread poller = new Thread() {

            public void run() {
                int exitCode = -99;
                boolean exited = false;
                do {
                    try {
                        exitCode = tac.exitValue();
                        exited = true;
                    } catch (IllegalThreadStateException e) {
                        System.out.println("still alive!");
                        try {
                            Thread.sleep(1000);
                        } catch (Exception ee) {
                        }
                    }
                } while (!exited);
                System.out.println("exitValue(): Process exited with code " + exitCode);
            }
        };
        poller.start();
        try {
            reader.join();
            writer.join();
            waiter.join();
            poller.join();
        } catch (InterruptedException eee) {
            eee.printStackTrace();
        }
    } catch (Throwable e) {
